import {Row, Col, Button, Card} from '../../BootstrapComponents/BootstrapComponents';

const Listing = () => {
    return ( 
        <Col md={6} lg={4}>
            <Card>
                <Card.Header>
                    <div className="float-left">
                        <h3>
                            <a href="#">Lease Option / Rent To Own</a>
                        </h3>
                    </div>
                    <div className="float-right">
                        <a href="#" className="font-weight-bold">Great Deal</a>
                    </div>
                </Card.Header>
                <Card.Img variant="top" src="" />
                <Card.Body>

                </Card.Body>
            </Card>
        </Col>
     );
}

export default Listing;
